	var createDendrogramData = function(node, out, base){
		var d = {
				y: (base || 1)
			},
			dist;
		if(node.children){
			dist = d.y;
			d.y -= (node.data? node.data.distance: 0);
			d.children = [];
			node.children.forEach(function(child){
				createDendrogramData(child, d.children, dist);
			});
		}
		else if(node.id.indexOf('|') < 0)
			d.name = node.id;
		if(out)
			out.push(d);
		else{
			out = d;
			out.y = 0;
		}
		return out;
	};

